import React from "react";
import { useGlobalContext } from "../context";

export default function Meal(){
    const { meals } = useGlobalContext()
    console.log(meals)
   
    return (
        <section className="cards container"> 
            { meals.map((me)=>{
            return (

                <div key={me.idMeal} className='card m-5'>
                 <img scr={{uri:me.strMealThumb}} alt='img1'/>

                 <h4 className="card-title">{ me.strMeal}</h4>
                
                 </div>
                
            )
        })}
       </section> 

    )
}
